import { Table } from "react-bootstrap";
import axios from "axios";

export default function Pagination() {
  const [Data, setData] = useState([]);

  useEffect(() => {
    getdata();
  }, []);

  function getdata() {
    const url = "https://randomuser.me/api/";
    axios.get(url).then((res) => {
      console.log(res.data);
    });
  }

  return (
    <>
      <div className="container mt-5">
        <Table striped hover>
          <thead>
            <tr>
              <th>#</th>
              <th>First Name</th>
              <th>Last Name</th>
              <th>Username</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>1</td>
              <td>Mark</td>
              <td>Otto</td>
              <td>@mdo</td>
            </tr>
            <tr>
              <td>2</td>
              <td>Jacob</td>
              <td>Thornton</td>
              <td>@fat</td>
            </tr>
            <tr>
              <td>3</td>
              <td>Larry the Bird</td>
              <td>@twitter</td>
              <td>@twitter</td>
            </tr>
          </tbody>
        </Table>
      </div>
    </>
  );
}
